"GameOn" - Restries de integridade
R1: Gerado pelo sistema;
R2: obrigatoriamente um de 'Ativo', 'Inativo' ou 'Banido';
R3: Alfanumrico de dimenso 10;
R4: URL para uma pgina com os detalhes do jogo;
R5: Sequencial
R6: 1 <= X <= 5;
R7: obrigatoriamente um de 'Por iniciar', 'A aguardar jogadores', 'Em curso' e 'Terminada';
R8: Os jogadores tm de ser da regio da partida para poderem jogar;
R9: URL para imagem do crach;
R10: nico e no nulo, mas no chave primria.
NOTA:Assume-se a existncia de um sistemaque atualiza a pontuao e estado durante a execuo do jogo.
